import React from "react";
import "./home.css"; 

const Prof = () => {
    const members = [
      { name: "Jane Doe", role: "UI & UX Designer" },
      { name: "Alex Smith", role: "CEO Expert" },
      { name: "Emily New", role: "Web Designer" },
      { name: "Lisa Boley", role: "Marketing Coordinator" }
    ];
  
    return (
      <div className="container mx-auto p-4 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
        {members.map((member, index) => (
          <div key={index} className="bg-white shadow-lg rounded-xl p-4 text-center">
            <h2 className="text-xl font-semibold">{member.name}</h2>
            <span className="text-gray-500">{member.role}</span>
          </div>
        ))}
      </div>
    );
  };
  
  export default TeamMembers;
